import React from "react";
import { Grid, makeStyles } from "@material-ui/core";

import GridComponent from "../common/Grid/Grid";
import Post from "./Post";

const useStyles = makeStyles({
  gridItems: {
    alignSelf: "auto",
  },
});

export default function Posts({ items, onLike, onDisLike }) {
  const classes = useStyles();
  return (
    <GridComponent>
      {items.map((i) => (
        <Grid item xs={3} key={i.id} className={classes.gridItems}>
          <Post post={i} onLike={onLike} onDisLike={onDisLike} />
        </Grid>
      ))}
    </GridComponent>
  );
}
